import React, { Component } from 'react';
import { connect } from "react-redux";
import HomeHeader from '../../HomePage/HomeHeader';
import './CategorySelect.scss'
import HomeFooter from '../../HomePage/Section/HomeFooter';
class CategorySelect extends Component {

    constructor(props) {
        super(props);
        this.state = {
            detailDoctor: {}
        }
    }

    async componentDidMount() {
    }
    render() {
        return (
            <>
                <HomeHeader
                    isShowBanner={false}
                />
                <div className='category-container'>
                    <div className='row category-intro'>
                        <span className='category-intro-item'>
                            CAC CHUYEN KHOA PHO BIEN
                        </span>
                    </div>
                    <div class="row">
                        <div className='col-4 category-sidebar'>
                            <nav class="category">
                                <h3 class="category-sidebar-heading">
                                   Trang chu
                                </h3>
                                <ul class="category-list">
                                    <li class="category-item ">
                                    </li>
                                    <li class="category-item ">
                                        
                                    </li>
                                </ul>
                                <div id="Cateimg" class="home-product-item__img" style="background-image:url(https://cf.shopee.vn/file/4fec096d5d273e37e7fc7bb14d24173f);"></div>
                                <div class="home-product-item__img" style="background-image:url(https://www.ontopvn.com/wp-content/uploads/2020/05/shop-ban-quan-ao-danh-cho-nam-o-da-nang.jpg);"></div>
                            </nav>
                        </div>
                        <div className='col-8 category-content-item' >

                        </div>
                    </div>
                </div>
                <HomeFooter />
            </>
        );
    }
}

const mapStateToProps = state => {
    return {
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(CategorySelect);
